  const [user, setUser] = useState([])

  return (
    <div className="App">
      {
        !user.length > 0
          ? < Promociones setUser={setUser} />
          : <AppBlackWings user={user} setUser={setUser} />  
      }

    </div>
  );
}

export default App;
